import React from 'react'

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="row">
          <div className="col-3">
            sidebar
          </div>
          <div className="col-9 main">
            main
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
